import logo from './logo.svg';
import './App.css'; //import css 경로
import Box from "./Box";

function App() {

  let post = '빵빵~ 빵빵~ C조 나간다~'


  return (
    <div className="App"> 
      <div className="black-nav">
        <h4 id={post}>COMP C조</h4>
      </div>
      <h4>{post}</h4>
      <h2>C조</h2>
      <div className="box-container">
        <Box name="박유나" major="경영학부"/>
        <Box name="심성민" major="산업보안학과"/>
        <Box name="손다혜" major="건설환경플렌트공학과"/>
        <Box name="이소율" major="경영학부"/>
        <Box name="오휘민" major="소프트웨어학부"/>
      </div>
      다들 정말 재미있는 1학기 스터디 만들어줘서 너무 고맙고,<br></br>
      같이 여행도 갔다올만큼 많이 친해질 수 있어서 좋았어<br></br><br></br>
      덕분에 1학기가 더 즐거웠던 것 같아. 앞으로도 더 친하고 재밌게 지내자!
    </div>
  );
}

export default App;

